import Gamer from '../components/Gamer'

const Game = props => {


    return (
        <div className="game-container">
            <h4>here i want a table with names in first column and</h4>
            <h4>total skore set to 0 init second column</h4>
            <h4>input current skore third column</h4>
            <h4>tick icon fourth column</h4>
            <ul>
                {props.playing.map(player => (
                    <Gamer
                        key={player.id}
                        id={player.id}
                    />
                ))}
            </ul>

        </div>
    );

};

export default Game;
